const users = ["User 2", "User 1", "User 11"]

users.sort();

console.log(users);
// ["User 1", "User 11", "User 2"]

const collator = new Intl.Collator("en", { numeric: true })
users.sort(collator.compare)

console.log(users);
// ["User 1", "User 2", "User 11"]

const numbers = [22, 3, 2, 1, 30, 100]

numbers.sort();

console.log(numbers);
// [1, 100, 2, 22, 3, 30]

numbers.sort((a, b) => a - b)

console.log(numbers);
// [1, 2, 3, 22, 30, 100]
